function ObjToChar( o )

   local hObj := {=&gt;}, aDatas := __objGetMsgList( o, .T. )
   local hPairs := {=&gt;}

   hObj[ "CLASS" ]   = o:ClassName()

   AEval( aDatas, { | cData | hPairs[ cData ] := __ObjSendMsg( o, cData ) } )
   hObj[ "DATAs" ]   = hPairs
   hObj[ "METHODs" ] = __objGetMsgList( o, .F. )

return ValToChar( hObj )

